import { ActionTypes } from "../constants/action-types";
const initialState = {
  products: [
    {
      id: 1,
      title: "Dipesh",
      category: "Programmer"
    },
  ],
};

export const productReducer = (state, { type, payload }) => {
  switch (type) {
    case ActionTypes.SELECTED_PRODUCT:
      return state;
    default:
      return state;
  }
};
